import React from 'react';

//import data
import {nav} from '../data';

const Nav = () => {
  return (
    <nav className='hidden lg:flex'>
      <ul className='flex text-white gap-x-8'>
        {nav.map((item, idx) => {
          return <li key={idx}>
            <a 
              className='hover:text-primary-500'
              href={item.href}
            >
              {item.name}
            </a>
          </li>
        })}
      </ul>
    </nav>
  );
};

export default Nav;
